import React from 'react';
// import '../App.css';
import cover from './cover.png';
import Cover from './Cover';
import Socials from './Socials';
import BookDisplay from './BookDisplay';

function Home(){
    return(
        <>
            <Cover />
            <Socials />
            <BookDisplay />
        </>
    );
}

export default Home;
